import React, { useState, useEffect } from "react";
import '../estilos/App.css';
import { 
    obtenerDatosSecundariaYSuperior, 
    obtenerDatosTecnicaturasYCursos, 
    obtenerDatosCertificaciones 
} from "../api.js";
import Acordeon from "../componentes/Acordeon";
import TarjetasTitulos from "../componentes/TarjetasTitulos";

const Formacion = () => {
    const [datosSecundariaYSuperior, setDatosSecundariaYSuperior] = useState([]);
    const [datosTecnicaturasYCursos, setDatosTecnicaturasYCursos] = useState([]);
    const [datosCertificaciones, setDatosCertificaciones] = useState([]);
    const [isSecundariaYSuperiorOpen, setIsSecundariaYSuperiorOpen] = useState(false);
    const [isTecnicaturasYCursosOpen, setIsTecnicaturasYCursosOpen] = useState(false);
    const [isCertificacionesOpen, setIsCertificacionesOpen] = useState(false);

    useEffect(() => {
        const obtenerDatos = async () => {
            const secundariaYSuperior = await obtenerDatosSecundariaYSuperior();
            setDatosSecundariaYSuperior(secundariaYSuperior);

            const tecnicaturasYCursos = await obtenerDatosTecnicaturasYCursos();
            setDatosTecnicaturasYCursos(tecnicaturasYCursos);

            const certificaciones = await obtenerDatosCertificaciones();
            setDatosCertificaciones(certificaciones);
        };
        obtenerDatos();
    }, []);

    return (
        <section className="Formacion">
            <h3>Formación</h3>
            <div className={`seccionConBordes ${isSecundariaYSuperiorOpen ? 'open' : ''}`}>
                <div className="header" onClick={() => setIsSecundariaYSuperiorOpen(!isSecundariaYSuperiorOpen)}>
                    <h4>Educación secundaria y superior</h4>
                    <i className={`fa-solid fa-chevron-down ${isSecundariaYSuperiorOpen ? 'rotate' : ''}`}></i>
                </div>
                {isSecundariaYSuperiorOpen && (
                    <div className="content">
                        <ul className="acordeones">
                            {datosSecundariaYSuperior.map((item, index) => (
                                <Acordeon key={index} lugar={item.lugar} descripcion={item.descripcion} />
                            ))}
                        </ul>
                    </div>
                )}
            </div>
            <div className={`seccionConBordes ${isTecnicaturasYCursosOpen ? 'open' : ''}`}>
                <div className="header" onClick={() => setIsTecnicaturasYCursosOpen(!isTecnicaturasYCursosOpen)}>
                    <h4>Tecnicaturas y cursos</h4>
                    <i className={`fa-solid fa-chevron-down ${isTecnicaturasYCursosOpen ? 'rotate' : ''}`}></i>
                </div>
                {isTecnicaturasYCursosOpen && (
                    <div className="content">
                        <ul className="acordeones">
                            {datosTecnicaturasYCursos.map((item, index) => (
                                <Acordeon key={index} lugar={item.lugar} descripcion={item.descripcion} />
                            ))}
                        </ul>
                    </div>
                )}
            </div>
            <div className={`seccionConBordes ${isCertificacionesOpen ? 'open' : ''}`}>
                <div className="header" onClick={() => setIsCertificacionesOpen(!isCertificacionesOpen)}>
                    <h4>Títulos y certificaciones</h4>
                    <i className={`fa-solid fa-chevron-down ${isCertificacionesOpen ? 'rotate' : ''}`}></i>
                </div>
                {isCertificacionesOpen && (
                    <div className="content">
                        <TarjetasTitulos data={datosCertificaciones} />
                    </div>
                )}
            </div>
        </section>
    );
}

export default Formacion;
